import React, { useState } from 'react';
import { FetchMealByFirstLetter } from '../services/mealtService';


function Home() {
	const { meals } = useMealContext();

	return (
		<div className="page">
        {meals.map((meal) => (
          <div key={meal.idMeal} className="meal-card">
            <img src={meal.strMealThumb} alt={meal.strMeal} />
            <h3>{meal.strMeal}</h3>
          </div>
        ))}
      </div>
	);
}

export default Home;
